import React, { useState } from 'react';

import Style from './addNewGoal.module.scss';
import { Button } from 'components';

export default function AddNewGoal() {
	async function addGoal(e) {
		try {
			e.preventDefault;
			console.log('ADDING NEW GOAL');
		} catch (e) {
			console.log(e);
		}
	}

	return (
		<div className={Style.Container}>
			<h4>Add New Goal</h4>
			<form method='POST' className={Style.form}>
				<div>
					<label htmlFor='goal'>Goal</label>
					<input type='text' name='goal' id='goal' />
				</div>
				<div>
					<label htmlFor='category'>Category</label>
					<select name='category' id='category'>
						<option value=''>--Select--</option>
						<option value='Fitness'>Fitness</option>
						<option value='Nutrition'>Nutrition</option>
						<option value='Mindfulness'>Mindfulness</option>
					</select>
				</div>
				<div>
					<label htmlFor='times'>Times per week</label>
					<input type='number' id='times' />
				</div>
				<Button text='Im the button bro' onClick={addGoal} />
			</form>
		</div>
	);
}
